import React from 'react';

const Profile = ({ profileData }) => {

    return (
        <div>
            <div className="awards-portfolio">
                <h3>프로필</h3>
                {
                    Array.from(profileData).map(profile => {
                        return (
                            <div key={`profile_${profile.id}`}>
                                <p>{profile.name}</p>
                                <p>{profile.comments}</p>
                            </div>
                        )
                    })
                }
            </div>
        </div>
    );
    
}

export default Profile;
